html_content:
/* 
    Layout: Two Column
	Theme Name: Vanilla
	Description: Vanilla is a starter shopping cart theme for Infusionsoft.
	Author: Fusetastic
	Author URI: http://www.fusetastic.com
	Version: 1.0
	License: GNU General Public License v2.0 (or later)
	License URI: http://www.opensource.org/licenses/gpl-license.php
	HTML version 2
The following styles control the general layout of your store
===============================================================*/
html, body, div, span, applet, object, iframe, p, blockquote, pre,
a, abbr, acronym, address, big, cite, code,
del, dfn, em, img, ins, kbd, q, s, samp,
small, strike, strong, sub, sup, tt, var,
b, u, i, center,
dl, dt, dd, ol, ul, li,
fieldset, form, label, legend,
table, caption, tbody, tfoot, thead, tr, th, td,
article, aside, canvas, details, embed, 
figure, figcaption, footer, header, hgroup, 
menu, nav, output, ruby, section, summary,
time, mark, audio, video {
	margin: 0;
	padding: 0;
	border: 0;
	vertical-align: baseline;
}
/* HTML5 display-role reset for older browsers */
article, aside, details, figcaption, figure, 
footer, header, hgroup, menu, nav, section {
	display: block;
}

body {line-height: 1.3;}
ol, ul {
	list-style: none;
}
blockquote, q {
	quotes: none;
}
blockquote:before, blockquote:after,
q:before, q:after {
	content: '';
	content: none;
}
table {
	border-collapse: collapse;
	border-spacing: 0;
}
#wrapper {
	/* Wraps around everything and sets the total width of the storefront */
	position: relative;
	width: 960px;
	margin: 0 auto;
	padding: 10px 10px 0 10px;	
}

#wrapperCheckout {
	/* Wrapper with 25px top margin to compensate for missing topNav on checkout pages */
  position: relative;
  width: 960px;
  margin: 30px auto 0 auto;
  padding: 10px 10px 0 10px;
}
/* TOP NAVIGATION AND HEADER
===============================================================*/
#topNav {
    /* Contains 'View Cart' link and search field */
	width: 960px;
	height: 25px;
	margin: 10px auto 5px auto;
	font-size: 12px;
	}
#topNav ul {
	list-style: none;
	margin: 0;
	float: right;
	}
#topNav li {
	padding-left: 30px;
	list-style-image: none;
	display: inline;
	}
#header {
	/* Contains your banner/logo */
	margin: 0 0 15px 0;
}
#header h1 {
  margin: 0;
  line-height: 1;
}
/* LEFT SIDEBAR AND MAIN NAVIGATION
===============================================================*/
#leftBar {
	/* Contains main navigation */
  float: left;
  width: 200px;
	}
#nav {
	overflow: hidden;
	}
#nav ul, #subCat ul {
	}
#nav li {
	}
#subCat li {
  padding-left: 15px;
	}
#nav a {
  padding: 12px 10px 10px 10px;
  display: block;
	}
#subCat a {
	display: block;
	padding: 15px 10px 5px 10px;
	}
.navHeader {
	margin: 30px 0 0 10px;
}

.listHeader {
  width: 180px;
  padding: 12px 10px 10px 10px;  
}
#customLeftBarTop, #nav {
  margin: 0 0 25px 0;
}
#customLeftBarTop {
  padding: 10px;
}
#customLeftBarTop p {
  margin: 10px 0;
}
/* CONTENT / CHECKOUT
===============================================================*/
#content {
	/* Content wrapper used on browsing pages */
  position: relative;
  width: 740px;
  float: right;
  margin: 0 0 40px 0;
	}
#contentWide {
	/* Content wrapper used on checkout pages */
	position: relative;
	width: 920px;
	margin: 35px auto 0 auto;
	}
#contentProductDetail {
    /* Content wrapper used on product details page */
    position: relative;
	width: 740px;
	float: right;
	margin: 0 0 40px 0;
    }
#promoBanner {
    /* Large banner on home page */
	margin-bottom: 20px;
	}
#breadcrumbs {
	margin: 5px 0 25px 0;
	}
#breadcrumbs ul {
	}
#breadcrumbs li {
	padding-right: 10px;
	display: inline;
	}
#breadcrumbs li:after {
	/* Symbol to be displayed between breadcrumbs */
   content: ">";
   margin-left: 10px;
	}
#breadcrumbs li:last-child:after {
	/* Removes the > after last breadcrumb */
	content: "";
	}
#productGrid ul {
  margin: 10px 0 10px 0;
  width: 740px;
	}
#productGrid li {
    width: 170px;
    height: 250px;
    display: inline;
    text-align: center;
    float: left;
    margin: 25px;
    padding: 10px;
	}
#productGrid .last {

}
#productGrid a {

	}
#productGrid a:hover {
	text-decoration: underline;
}
.productImage {
	/* The image that appear in the product grid */
width: 170px;
	margin-bottom: 5px;
	}
.productLarge {
	/* The larger image on the product details page */
	float: left;
	}
.price {
	/* Price shown on product details page */
	margin: 0 0 15px 0;
	}
.productDescriptionShort {
    /* Paragraph for short product description on product details page */
	margin: 0;
	}
.productQty {
    /* Product quantity field on product details page */
	padding: 4px 4px 4px 6px;
	height: 14px;
	width: 20px;
	text-align: right;
	margin-bottom: 5px;
	}
#productDetails {
    /* Container on product details that wraps around everything from product name to add to cart button */
	overflow: hidden;
	padding: 0 20px;
	}
#productDescription {
    /* Contains the long product description on product details page */
	width: 720px;
	clear: both;
	padding: 20px 0 0 0;
	}
#productDescription ul {
   margin: 15px 0 15px 30px;
    list-style-type: disc;
}
#productDetails ul {
	margin: 15px 0 25px 0;
	}
#productDetails li {
	}
.productDrop {
	/* Dropdown list for product options */
	margin: 0;
	}
.optionName {
	/* Label for product option dropdown */
	width: 60px;
	height: 20px;
	float: left;
	}
table.productTable {
	margin: 20px 0 0 10px;
	padding: 4px;
	}
.productTable td {
	padding: 4px;
	}
td.bottom {
	vertical-align: bottom;
	}
/* CART AND CHECKOUT
===============================================================*/
input {
	margin: 0 0 7px 0;
	}
/* Cart contents
---------------------------------------------*/
.qtyField {
    /* Quantity field in cart */
	padding: 4px 4px 4px 6px;
	height: 14px;
	width: 20px;
	display: block;
	text-align: right;
	margin: 0 auto;
	margin-bottom: 5px;
	}
.cartThumb {
    /* Product thumbnail image in cart */
	float: left;
	margin: 0 10px 0 0;
	}
.updateCart {
    /* Update cart text */
	font-size: 10px;
	}
.updateCart a:link {
    /* Update cart link */
	text-decoration: none;
	}
.paymentLabel {
     /* Payment form label */
	display: block;
	}
.choosePlan {
    /* Class for radio buttons */
	margin-right: 5px;
	}
.promoCode {
    /* Table that contains promo code field */
	width: 450px;
	border-collapse: collapse;
	margin-bottom: 40px;
	}
.promoCode td {
	height: 30px;
	}
.shippingOptions {
	/* Radio buttons for shipping options */
	margin: 0 10px 3px 0;
	}
.address, .editInfo, .shippingOptions, .cardInfo, .shipInfo {
	margin: 0 0 4px 0;
	display: block;
	}
.billName, .billStreet, .billCity, .shipName, .shipStreet, .shipCity {
	margin: 0;
	display: block;
	}
/* Form fields and labels
---------------------------------------------*/
.checkout {
	/* Form fields used in checkout forms */
	padding: 4px 4px 4px 6px;
	margin: 0;
	width: 200px;
	}
.checkoutBottom {
	/* Provides bottom padding for last form field in a form */
	padding: 4px 4px 4px 6px;
	margin: 0 0 20px 0;
	width: 200px;
	height: 18px;
	}
.checkoutTop {
	/* Provides top padding for first form field in a form */
	padding: 4px 4px 4px 6px;
	margin: 10px 0 0 0;
	width: 200px;
	height: 18px;
	}
.checkoutTopShort {
	/* Provides top padding for first form field in a form */
	padding: 4px 4px 4px 6px;
	margin: 10px 0 0 0;
	width: 125px;
	height: 18px;
	}
.checkoutLabel {
    /* Checkout form label */
	padding: 0 0 -3px 0;
	margin: 0 0 -3px 0;
	}
.checkoutShort, .search, .promoField {
    /* Smaller form field */
	padding: 4px;
	margin: 0;
	width: 125px;
	}
.checkoutShortest {
    /* Even smaller form field */
	padding: 5px;
	margin: 0;
	width: 70px;
	}
.signinField {
    /* Shorter form field for sign in table */
	padding: 4px 4px 4px 6px;
	margin: 0 0 0 0;
	width: 160px;
	height: 18px;
	}
.signinTop {
	/* Provides top padding for first form field in a form */
	padding: 4px 4px 4px 6px;
	margin: 10px 0 0 0;
	width: 160px;
	height: 18px;
	}
.signinLabel {
    /* Text label used in sign in table */
	text-align: right;
	width: 150px;
	}
.paymentIcon {
    margin: 0 7px -5px 4px;
    }
/* Tables
---------------------------------------------*/
.viewCart {
	width: 100%;
	border-collapse: collapse;
	margin-bottom: 20px;
	float: left;
	}
.viewCart th, .viewCartShort th, .payPlan th, .summaryCart th, .shippingInfo th, .billingInfo th, .billingTable th, .shippingTable th, .paymentInfo th, .signinTable th, .paymentMethodTable th, .forgotPasswordTable th {
	padding: 10px 10px 10px 15px;
	text-align: left;
	}
.viewCart td, .viewCartShort td, .payPlan td, .summaryCart td, .billingTable, .shippingInfo td, .billingInfo td, .paymentInfo td, .paymentMethodTable td, .forgotPasswordTable td {
	padding: 10px 10px 10px 15px;
	vertical-align: top;
	}
.payPlan {
	/* Table on view cart page that contains available pay plans */
	width: 270px;
	border-collapse: collapse;
	margin: 50px 0 20px 20px;
	text-align: left;
	float: right;
	}
.tableContainer {
    /* Wraps around cart table to make it stretch to 100% width when no payment plans are displayed */
	overflow: hidden;
	}
.tableContainer > table {
    /* Sets cart table to 100% width when no payment plans are displayed */
	width: 100%;
	}
.billingTable {
    /* Table for entering billing address */
	width: 450px;
	border-collapse: collapse;
	margin: 40px 20px 20px 0;
	text-align: left;
	float: left;
	}
.shippingTable {
    /* Table for entering shipping address */
	width: 450px;
	border-collapse: collapse;
	margin: 40px 0 20px 0;
	text-align: left;
	float: left;
	}
.paymentMethodTable {
    /* Table for entering payment method */
	width: 100%;
	border-collapse: collapse;
	margin: 0 0 20px 0;
	text-align: left;
	float: left;
	}
td.pay1 {
    /* First column in .paymentMethodTable */
    width: 220px;
    padding-bottom: 20px;
    }
td.pay2 {
    /* First column in .paymentMethodTable */
    width: 231px;
    padding-bottom: 20px;
    }
td.pay3 {
    /* First column in .paymentMethodTable */
    width: 162px;
    padding-bottom: 20px;
    }
td.pay4 {
    /* First column in .paymentMethodTable */
    padding-bottom: 20px;
    }
.signinTable {
    /* Table for signing in or registering new customer */
	width: 340px;
	border-collapse: collapse;
	margin: 0 0 120px 20px;
	text-align: left;
	float: left;
	}
.signinTable td {
	padding: 5px 10px 3px 15px;
	vertical-align: top;
	}
.shippingTable td, .billingTable td {
	border: none;
	padding: 5px 0 0 15px;
	}
td.rightAlign, th.rightAlign {
	text-align: right;
	vertical-align: top;
	padding-top: 10px;
	}
td.rightAlignTop, th.rightAlignTop {
	text-align: right;
	vertical-align: top;
	padding-top: 20px;
	width: 150px;
	}
td.rightAlignBottom {
	text-align: right;
	vertical-align: top;
	padding: 10px 10px 20px 0;
	width: 150px;
	}
p.forgotPassword {
	margin: 10px 0 0 0;
	padding: 0;
	}
td.leftAlign, th.leftAlign {
	text-align: left;
	}
td.centerAlign, th.centerAlign {
	text-align: center;
	}
td .rightCell {
	text-align: right;
	}
.summaryCart {
	width: 100%;
	border-collapse: collapse;
	margin-bottom: 20px;
	float: left;
	}
.shippingInfo {
	/* Table for shipping info on summary page */
	width: 293px;
	border-collapse: collapse;
	text-align: left;
	margin: 0 20px 20px 0;
	float: left;
	clear: none;
	}
.billingInfo {
	/* Table for billing info on summary page */
	width: 293px;
	border-collapse: collapse;
	margin: 0 20px 20px 0;
	text-align: left;
	float: left;
	clear: none;
	}
.paymentInfo {
	/* Table for pay plan info and scheduled payments on summary page */
	width: 293px;
	border-collapse: collapse;
	margin: 0;
	padding: 10px;
	text-align: left;
	float: left;
	clear: none;
	}
.cellMedium {
	height: 60px;
	}
.cellTall {
	height: 100px;
	}
.cellLow {
	height: 20px;
	}
/* Containers
---------------------------------------------*/
#signinContainer {
	width: 720px;
	margin: 40px auto 0 auto;
	padding-top: 40px;
	}
#summaryContainer {
	/* Container for billing, shipping & payment boxes */
	width: 960px;
	clear: both;
	}
.checkoutLinksTop {
    height: 30px;
    margin: 0;
    position: absolute;
    right: 0;
    text-align: right;
    width: 300px;
}
.checkoutLinks {
	width: 300px;
	height: 30px;
	margin: 17px 20px 40px 0;
	text-align: right;
	float: right;
	clear: both;
	}
#checkoutLinksSummary {
	position: absolute;
	top: 570px;
	right: 0;
	width: 300px;
	height: 30px;
	margin: 17px 0 30px 0;
	text-align: right;
	float: right;
	}
/* Forgot password
---------------------------------------------*/
#forgotPasswordWindow {
	width: 550px;
	height: 300px;
	margin: 0 auto;
	padding: 40px;
	}
.forgotPasswordTable {
	width: 500px;
	border-collapse: collapse;
	margin: 0 0 120px 20px;
	text-align: left;
	}
/* UPSELLS
===============================================================*/
#upsellContainer {
	width: 940px;
	clear: both;
	margin: 20px 0 0 0;
	padding-bottom: 40px;
	height: 200px;
	}
#upsellContainer li {
	display: inline;
	margin-right: 20px;
	}
.upsell {
	width: 250px;
	padding: 10px 20px 20px 20px;
	float: left;
	margin: 0 20px 0 0;
	}
.upsellImage {
	float: left;
	margin: 3px 15px 0 0;
	}
.upsellItem {
	font-size: 15px;
	font-weight: bold;
	margin-right: 10px;
	}
.subscriptionPrice {
	margin: 0;
	}
.upsellAdd {
	float: right;
	margin: 10px 15px 0 0;
	}
/* TYPOGRAPHY
===============================================================*/
h1 {
    /* Used for product and page headers */
	margin: 0 0 15px 0;
	}
h2 {
	margin: 0 0 5px 0;
    padding-bottom: 5px;
	}
h3 {
	margin: 0 0 15px 0;
	}
h4 {
	margin: 20px 0 5px 0;
	}
#upsellContainer h4 {
	margin: 0 0 5px 0;
	}
h5 {
	margin: 2px 0 5px 5px;
	}
.tableHeader {
	margin: 20px 0 5px 0;
	display: block;
	}
p.homeLink {
	float: right;
	margin-bottom: 40px;
	}
/* LINKS AND BUTTONS
===============================================================*/
a {
	text-decoration: none;
	}
a:hover {
	text-decoration: underline;
	}
.codeButton {
	padding: 7px 15px 5px 15px;
	margin: 2px 0 0 15px;
    cursor: pointer;
	}
.continueButton, .formButton {
	padding: 7px 15px 5px 15px;
	margin: 10px 0 0 10px;
    cursor: pointer;
	}
.cartButton, .continueButton {
	padding: 7px 15px 5px 15px;
	margin-top: 10px;
    cursor: pointer;
	}
.newsButton {
	margin-left: 85px;
	padding: 7px 15px 5px 15px;
    cursor: pointer;
	}
.searchButton {
	margin: 1px 0 0 5px;
	padding: 4px 9px 4px 9px;
    cursor: pointer;
	}
.upsellButton {
	margin: 1px 0 10px 5px;
	padding: 4px 9px 4px 9px;
    cursor: pointer;
	}
.buttonRight a:hover, .buttonLeft a:hover {
	text-decoration: none;
	}
/* FOOTER
===============================================================*/
#footer {
	position: relative;
	margin-top: 40px;
	padding-top: 30px;
	width: 100%;
	height: 50px;
	text-align: center;
	clear: both;
	}
/* HTML AREAS
===============================================================*/
#customCheckoutBottom {
	clear: both;
	}
#customHomeProductGridTop {
	width: 740px;
	margin-bottom: 20px;
	}
/* MISC
===============================================================*/
.payPalImage {
	margin: 0 0 -5px 0;
	}
p.successMessage {
	margin: 20px 0 20px 0;
	}

/*
    Layout: One Column
	Theme Name: Vanilla
	Description: Vanilla is a starter shopping cart theme for Infusionsoft.
	Author: Fusetastic
	Author URI: http://www.fusetastic.com
	Version: 1.0
	License: GNU General Public License v2.0 (or later)
	License URI: http://www.opensource.org/licenses/gpl-license.php
	HTML version 2
Controls fonts, colors and images.
===============================================================*/
body {
	 font: 13px/1.5 "Trebuchet MS", Tahoma, Arial, sans-serif;
    color: #333;
    background-color: #eee;
	}
td {
    font: 13px/1.5 "Trebuchet MS", Tahoma, Arial, sans-serif;
}
#wrapper {
  background-color: #fff;
  -moz-border-radius: 5px 5px 0 0;
  -webkit-border-radius: 5px 5px 0 0;
  border-radius: 5px 5px 0 0;
	}
#wrapperCheckout {
	background-color: #fff;
	}
/* NAVIGATION
===============================================================*/
#nav {
	background-color: #f7f7f7;
	}
#nav li a {
	background-color: #f7f7f7;
	border-right: 1px solid #e6e6e6;
	color: #666;
	}
#nav li a:hover {
	background-color: #eee;
	}
#nav a {
	text-decoration: none;
	color: #6666;
	}
#nav a:hover {
	color: #333;
	}
/* CONTENT / PRODUCT
===============================================================*/
.price {
	/* Price shown on product details page */
	font: 18px bold "Trebuchet MS", Tahoma, Arial,sans-serif;
	}
.productName {
     /* Product name in product grid */
	font-size: 18px;
	font-weight: normal;
	color: #333;
	}
.priceBold {
    /* Product price in product grid */
	font-weight: bold;
	}
.productGridOneCol {
   border: 1px solid #999999;
  -moz-border-radius: 5px;
  -webkit-border-radius: 5px;
  border-radius: 5px;
  -moz-box-shadow: 1px 1px 5px #ccc;
  -webkit-box-shadow: 1px 1px 5px #ccc;
  box-shadow: 1px 1px 5px #ccc;
 }
#productGrid a {
	color: #333;
    text-decoration: none;
	}
#productGrid a:hover {
	text-decoration: underline;
	}
.productGridOneCol {
	}
.subscriptionPrice {
    font-family: "Trebuchet MS", Tahoma, Arial, sans-serif;
    }
/* CART AND CHECKOUT
===============================================================*/
.cartDiscount {
    /* Discount shown in cart */
	color: #d44;
    }
.cartProduct {
    /* Product name in cart */
    font-weight: bold;
    }
.removeItem {
    /* Remove item link in cart */
	color: #333;
	}
.discountedPrice {
	/* Slashed price in cart */
    text-decoration:line-through;
    }

.search, .promoField {
    /* Text fields for search and promo code */
	color: #999;
	border: 1px solid #999;
	border-radius: 2px;
	-moz-border-radius: 2px;
	-webkit-border-radius: 2px;
	}
.checkout, .checkoutShort, .checkoutShortest, .checkoutBottom, .checkoutTop, .checkoutTopShort, .signinField, .signinTop, .productQty, .qtyField  {
	/* Form fields used in checkout forms */
	border: 1px solid #999;
	border-radius: 2px;
	-moz-border-radius: 2px;
	-webkit-border-radius: 2px;
	}
.shippingTable {
	border: 1px solid #ccc;
	}
.payPlan, .paymentInfo, .shippingInfo, .billingInfo, .shippingTable, .billingTable, .signinTable, .paymentMethodTable  {
	border: 1px solid #ccc;
	}
.promoCode th {
	border-bottom: 1px solid #ccc;
    border-top: 1px solid #ccc;
	}
.viewCart th, .viewCartShort th, .payPlan th, .summaryCart th, .shippingInfo th, .billingInfo th, .billingTable th, .shippingTable th, .paymentInfo th, .signinTable th, .paymentMethodTable th {
	border-bottom: 1px solid #ccc;
	background-color: #f7f7f7;
	}
.viewCart td, .viewCartShort td, .payPlan td, .summaryCart td, .shippingInfo td, .billingInfo td, .paymentInfo td {
	border-bottom: 1px solid #ccc;
	}
.subtotal {
	background-color: #f7f7f7;
	font-weight: bold;
	}
.financeCharge {
    font-size: 12px;
    color: #777;
    }
/* UPSELLS
===============================================================*/
.upsell {
	background-color: #f7f7f7;
	border: 1px solid #ccc;
}
#upsellContainer img {
	border: 1px solid #ccc;
	}
.upsellRegPrice {
	font-style: italic;
	}
/* TYPOGRAPHY
===============================================================*/
h1 {
    /* Used for product and page headers */
	color: #333;
	margin: 0 0 15px 0;
	letter-spacing: 1px;
	}
h2 {
    /* Used for product description header */
	color: #333;
	margin: 0 0 5px 0;
	}
h3 {
    /* Used for product grid headline */
	color: #333;
	border-bottom: 1px solid #999;
	}
h4 {
	color: #555;
	}
.tableHeader {
	color: #555;
	}
.smallHeader {
	font-size: 15px;
	font-weight: bold;
	}
/* LINKS AND BUTTONS
===============================================================*/
a {
	color: #666;
	text-decoration: none;
	}
a:hover {
	text-decoration: underline;
	}
 .newsButton, .formButton {
	background-color: #b1e1e5;
	border-radius: 2px;
	-moz-border-radius: 2px;
	-webkit-border-radius: 2px;
	text-shadow: 0 1px 0 #ebfeff;
	}
.buttonRight a:hover, .buttonLeft a:hover {
	color: #4e6364;
	}
.searchButton, .cartButton, .codeButton, .continueButton, .upsellButton {
    background-color: #646464;
	color: #fff;
    border-radius: 2px;
	-moz-border-radius: 2px;
	-webkit-border-radius: 2px;
	font: bold 12px Helvetica, Arial, sans-serif;
	}
