	HTML version 2
The following styles control the general layout of your store
===============================================================*/
* {
	margin: 0;
	padding: 0;
	}
img, img a {
    border: 0 none;
	}
#wrapper {
	/* Wraps around everything and sets the total width of the storefront */
	position: relative;
	width: 960px;
	margin: 0 auto;
	padding: 10px 10px 0 10px;
	}
#wrapperCheckout {
	/* Wrapper with 25px top margin to compensate for missing topNav on checkout pages */
	position: relative;
	width: 960px;
	margin: 30px auto 0 auto;
	padding: 10px 10px 0 10px;
	}
/* TOP NAVIGATION AND HEADER
===============================================================*/
#topNav {
    /* Contains View Cart link and search field */
	width: 960px;
	height: 25px;
	margin: 10px auto 5px auto;
	font-size: 12px;
	}
#topNav ul {
	list-style: none;
	margin: 0;
	float: right;
	}
#topNav li {
	padding-left: 30px;
	list-style-image: none;
	display: inline;
	}
#header {
	/* The main header that contains your banner or logo */
	width: 960px;
	margin-bottom: 10px;
	}
#nav {
	width: 960px;
	overflow: hidden;
	margin-top: 10px;
	}
#nav ul {
	list-style: none;
	margin: 7px 0 7px 0;
	}
#nav li {
	list-style-image: none;
	display: inline;
	}
#nav li a {
	padding: 9px 40px 11px 40px;
	}
#nav li a:hover {
	padding: 9px 40px 11px 40px;
	}
.navHeader {
	margin: 30px 0 0 10px;
	}
/* CONTENT / PRODUCT
===============================================================*/
#content {
    /* Content wrapper used on browsing pages */
	position: relative;
	width: 960px;
	margin: 10px auto 0 auto;
	}
#contentWide {
    /* Content wrapper used on checkout pages */
	position: relative;
	width: 920px;
	margin: 35px auto 0 auto;
	}
#contentProductDetail {
    /* Content wrapper used on product details page */
	position: relative;
	width: 920px;
	margin: 35px auto 0 auto;
	}
#promoBanner {
    /* Large banner on home page */
	margin-bottom: 20px;
	}
#breadcrumbs {
	margin: 0 0 15px 0;
	}
#breadcrumbs ul {
	list-style: none;
	margin: 0 -100px 3px 0;
	}
#breadcrumbs li {
	padding-right: 10px;
	list-style-image: none;
	display: inline;
	}
#breadcrumbs li:after {
	/* Symbol to be displayed between breadcrumbs */
   content: ">";
   margin-left: 10px;
	}
#breadcrumbs li:last-child:after {
	/* Removes the > after last breadcrumb */
	content: "";
	}
.productGridOneCol {
    /* Container for product image and description in product grid */
	position: relative;
	width: 425px;
    height: 200px;
	margin: 0 10px 40px;
  padding: 15px;
	float: left;
	}
.productGridOneCol img {
	margin: 0 20px 0 0;
	float: left;
	}
.price {
	/* Paragraph on product details page that contains product price */
	margin: 0 0 15px 0;
	}
.productImage {
    /* Contains the image that appears in the product grid */
    width: 170px;
    height: 170px;
    margin-bottom: 5px;
    }
.productImage img {
	float: left;
	}
.productLarge {
	/* Large image on product details page */
	float: left;
	}
.productQty {
    /* Product quantity field on product details page */
	padding: 4px 4px 4px 6px;
	height: 14px;
	width: 20px;
	display: block;
	text-align: right;
	margin-bottom: 5px;
	}
#productDetails {
    /* Container on product details that wraps around everything from product name to add to cart button */
	overflow: hidden;
	padding: 0 20px 0 20px;
	}
#productDescription {
    /* Contains the long product description on product details page */
	width: 100%;
	clear: both;
	padding: 20px 0 0 0;
	}
#productDescription ul {
  margin: 15px 30px 0;
}
.productDescriptionShort {
    /* Paragraph for short product description on product details page */
	margin: 0;
	width: 560px;
	}
.productDescriptionFront {
    /* Paragraph for product description in product grid */
	margin: 0;
	width: 425px;
	}
#productDetails ul {
	margin: 15px 0 25px 0;
	width: 960px;
	}
#productDetails li {
	list-style-type: none;
	width: 400px;
	}
.productDrop {
    /* Dropdown list for product options */
	margin: 0;
	}
.optionName {
    /* Label for product option dropdown */
	width: 60px;
	height: 20px;
	float: left;
	}
table.productTable {
	margin: 20px 0 0 10px;
	padding: 4px;
	}
.productTable td {
	padding: 4px;
	}
td.bottom {
	vertical-align: bottom;
	}
/* CART AND CHECKOUT
===============================================================*/
input {
	margin: 0 0 7px 0;
	}
#signinContainer {
	width: 720px;
	margin: 40px auto 0 auto;
	padding-top: 40px;
	}
/* Cart contents
---------------------------------------------*/
.qtyField {
     /* Quantity field in cart */
	padding: 4px 4px 4px 6px;
	height: 14px;
	width: 20px;
	display: block;
	text-align: right;
	margin: 0 auto;
	margin-bottom: 5px;
	}
.cartThumb {
    /* Product thumbnail image in cart */
	float: left;
	margin: 0 10px 0 0;
	}
.updateCart {
	font-size: 10px;
	}
.updateCart a:link {
	text-decoration: none;
	}
.paymentLabel {
	display: block;
	}
.choosePlan {
    /* Class for radio buttons */
	margin-right: 5px;
	}
