	width: 450px;
	border-collapse: collapse;
	margin-bottom: 40px;
	}
.promoCode td {
	height: 30px;
	}
.shippingOptions {
	/* Radio buttons for shipping options */
	margin: 0 10px 3px 0;
	}
.address, .editInfo, .shippingOptions, .cardInfo, .shipInfo {
	margin: 0 0 4px 0;
	display: block;
	}
.billName, .billStreet, .billCity, .shipName, .shipStreet, .shipCity {
	margin: 0;
	display: block;
	}
/* Form fields and labels
---------------------------------------------*/
.checkout {
	/* Form fields used in checkout forms */
	padding: 4px 4px 4px 6px;
	margin: 0;
	width: 200px;
	}
.checkoutBottom {
	/* Provides bottom padding for last form field in a form */
	padding: 4px 4px 4px 6px;
	margin: 0 0 20px 0;
	width: 200px;
	height: 18px;
	}
.checkoutTop {
	/* Provides top padding for first form field in a form */
	padding: 4px 4px 4px 6px;
	margin: 10px 0 0 0;
	width: 200px;
	height: 18px;
	}
.checkoutTopShort {
	/* Provides top padding for first form field in a form */
	padding: 4px 4px 4px 6px;
	margin: 10px 0 0 0;
	width: 125px;
	height: 18px;
	}
.checkoutLabel {
    /* Checkout form label */
	padding: 0 0 -3px 0;
	margin: 0 0 -3px 0;
	}
.checkoutShort, .search, .promoField {
    /* Smaller form field */
	padding: 4px;
	margin: 0;
	width: 125px;
	}
.checkoutShortest {
    /* Even smaller form field */
	padding: 5px;
	margin: 0;
	width: 70px;
	}
