	}
/* LINKS AND BUTTONS
===============================================================*/
a {
	text-decoration: none;
	}
a:hover {
	text-decoration: underline;
	}
.codeButton {
	padding: 7px 15px 5px 15px;
	margin: 0 0 0 15px;
    cursor: pointer;
