/* Layout: One Column
	Theme: Breeze v.2
The following styles control the general layout of your store
===============================================================*/
* {
	margin: 0;
	padding: 0;
	}
img, img a {
    border: 0 none;
	}
#wrapper {
	/* Wraps around everything and sets the total width of the storefront */
	position: relative;
	width: 960px;
	margin: 0 auto;
	padding: 10px 10px 0 10px;
	}
#wrapperCheckout {
	/* Wrapper with 25px top margin to compensate for missing topNav on checkout pages */
	position: relative;
	width: 960px;
	margin: 30px auto 0 auto;
	padding: 10px 10px 0 10px;
	}
 /* TOP NAVIGATION AND HEADER
===============================================================*/
#topNav {
    /* Contains View Cart link and search field */
	width: 960px;
	height: 25px;
	margin: 10px auto 5px auto;
	font-size: 12px;
	}
#topNav ul {
	list-style: none;
	margin: 0;
	float: right;
	}
#topNav li {
	padding-left: 30px;
	list-style-image: none;
	display: inline;
	}
#header {
	/* The main header that contains your banner/logo */
	width: 960px;
	margin: 20px 0 20px 0;
	}
#nav {
	width: 960px;
	margin-top: 10px;
	overflow: hidden;
	height: 62px;
	padding: 5px 0 0 0;
	}
#nav ul {
	list-style: none;
	margin: 18px 0 12px 0;
	}
#nav li {
	list-style-image: none;
	display: inline;
	}
#nav li a {
	padding: 16px 40px 12px 40px;
	}
#nav li a:hover {
	padding: 16px 40px 12px 40px;
	}
.navHeader {
	margin: 30px 0 0 10px;
	}
/* CONTENT / PRODUCT
===============================================================*/
#content {
     /* Content wrapper used on browsing pages */
	position: relative;
	width: 960px;
	margin: 10px auto 0 auto;
	}
#contentWide {
    /* Content wrapper used on checkout pages */
	position: relative;
	width: 920px;
	margin: 35px auto 0 auto;
	}
#contentProductDetail {
    /* Content wrapper used on product details page */
	position: relative;
	width: 920px;
	margin: 10px auto 0 auto;
	padding: 0 20px 40px 20px;
	}
#promoBanner {
     /* Large banner on home page */
	margin-bottom: 20px;
	}
#breadcrumbs {
	margin: 0 0 15px 0;
    padding-top: 10px;
	}
#breadcrumbs ul {
	list-style: none;
	margin: 0 -100px 3px 0;
	}
#breadcrumbs li {
	padding-right: 10px;
	list-style-image: none;
	display: inline;
	}
#breadcrumbs li:after {
	/* Symbol to be displayed between breadcrumbs */
   content: ">";
   margin-left: 10px;
	}
#breadcrumbs li:last-child:after {
	/* Removes the > after last breadcrumb */
	content: "";
	}
#productGrid a {
	text-decoration: none;
	}
#productGrid a:hover {
	text-decoration: underline;
	}
.productGridOneCol {
    /* Container for product image and description in product grid */
	position: relative;
	width: 460px;
    height: 250px;
    margin: 0 20px 40px 0;
	float: left;
	}
.productGridOneCol img {
	margin: 0 20px 0 0;
	float: left;
	}
.price {
	/* Paragraph on product details page that contains product price */
	margin: 0 0 15px 0;
	}
.productDescriptionShort {
    /* Paragraph on product details page that contains short product description */
	margin: 0;
	width: 560px;
	}
.productDescriptionFront {
	margin: 0;
	width: 450px;
	}
.productImage {
	/* Image in the product grid */
	margin-bottom: 5px;
	}
.productImage img {
	float: left;
	}
.subscriptionPrice {
    /* Product/subscription price on product details page */
	margin: 0;
	}
.productLarge {
	/* Large image on product details page */
	float: left;
    margin: 10px 20px 10px 0;
    border: 1px solid #ddd;
	}
.productQty {
    /* Product quantity field on product details page */
	padding: 4px 4px 4px 6px;
	height: 14px;
	width: 22px;
	display: block;
	text-align: right;
	margin-bottom: 5px;
	}
#productDetails {
    /* Container on product details that wraps around everything from product name to add to cart button */
	overflow: hidden;
	padding: 0 20px 0 20px;
