 Other than that, the third time was a beauty, was easy and simple to find, and I didn't have to ask anyone for help. (Hopefully it won't come back to me like the downgrade tickets.) organization/searchability more memes/gifs star wars  236 Newell newell.godwin@infusionsoft.com 9 Its good, I havent used it much, but when I did it was good     270 Nick nick.hendricks@infusionsoft.com 10 Its amazing. I wish it existed when I was BRAND new. Account Downgrade process Nothing Nothing  286 Steve Jobs steve.Jobs@infusionsoft.com 10 There have been a lot of articles that don't make sense to what is written in YOLOP also the process wasn't correct and was misleading to new reps Have troubleshooting docs in this area also so it truly is a doc where you only look one place instead of a doc where you only look one place for processes but look orther places for everything else. API Forum Post Not Answered link doesn't talk about the API forums with the exception of throttling. Not what you could expect when you click on "API Forum Post Not Answered"   282 Tim Reidhead tim.reidhead@infusionsoft.com 10 That is freakin sweet so far! I will have to use it more now that I know where this is. Then I could suggest more.     280 Tony anthony.patterson@infusionsoft.com 7 update some of the ticketing pipeline steps when sending a ticket up     242 Travis travis.lange@infusionsoft.com 10 I actually haven't used it that much but it looks pretty good. Using Ctrl+F works well for finding topics. Maybe embed a suggestion form at the top? Nice work.  76 Wyatt Mack wyatt.mack@infusionsoft.com 10 Just make sure it's up-to-date. For instance, the YOLOP states that for a contact/email package a ticket to CRT will be needed. If you do this, you get the ticket sent back to you telling you send it to systems, and to reference the YOLOP.     86 Ben Mosey benjamin.mosey@infusionsoft.com 7 Great idea. Searchability Accuracy Staying up to date on changes

