@import url(http://fonts.googleapis.com/css?family=Merriweather:400,400italic,700italic,700|Open+Sans:400,400italic,700,700italic|Lato:400,400italic,700,700italic);#outlook a {padding: 0;}
.ReadMsgBody, .ExternalClass {width: 100%;}
.ExternalClass * {line-height: 100%;}
body { background-color: #ffffff; margin: 0; padding: 0;
-webkit-text-size-adjust: 100%; -ms-text-size-adjust: 100%; }
table, td { border-collapse:collapse;
mso-table-lspace: 0pt; mso-table-rspace: 0pt; }
img { border: 0; height: auto; line-height: 100%;
outline: none; text-decoration: none;
-ms-interpolation-mode: bicubic; }
.column {display: inline-block; width: 100%;
text-align: left; vertical-align: top; }
@media only screen and (min-width:480px) {
.column-100, * [aria-labelledby='column-100'] {
width: 100% !important; display: inline-block;
text-align: left; vertical-align: top; }
.column-50, * [aria-labelledby='column-50'] {
width: 50% !important; display: inline-block;
text-align: left; vertical-align: top; }
.column-33, * [aria-labelledby='column-33'] {
width: 33% !important; display: inline-block;
text-align: left; vertical-align: top; }}
@media only screen and (max-width:479px) {
.socialBlock, td.imageBlock, .buttonBlock,
.alignmentContainer { text-align: center !important }
.alignmentContainer table { margin-right: auto;
margin-left: auto;}}  Section Header
